declare const SQL_QUERY = "\nUPDATE OR IGNORE Phone SET\n  \"number\" = IFNULL(@number, \"number\"), \"createdAt\" = IFNULL(@createdAt, \"createdAt\"), \"updatedAt\" = IFNULL(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"system\" = IFNULL(@system, \"system\"), \"sms\" = IFNULL(@sms, \"sms\"), \"voice\" = IFNULL(@voice, \"voice\"), \"ndnc\" = IFNULL(@ndnc, \"ndnc\")\nWHERE\n  \"number\" = @number\n";
export default SQL_QUERY;
